(215, 'Tình yêu không biên giới, không biểu đồ, không có quy tắc cứng nhắc. Nó tồn tại ở khắp nơi và không phân biệt tuổi tác, giới tính hay vị trí xã hội. Tình yêu có thể nảy sinh từ sự gắn kết gia đình, từ tình bạn chân thành hoặc từ tình yêu đôi lứa. Nó có thể xuất hiện trong những cử chỉ nhỏ nhặt, trong những lời nói chân thành hay trong những sự hi sinh vô điều kiện', '192.168.0.1', 'AcerNitro5', 197, 'https://toplist.vn/images/800px/loi-chuc-83-bang-tin-nhan-sms-cho-nguoi-yeu-o-xa-820654.jpg', '2023-06-27 03:04:54', NULL, NULL, NULL, NULL, NULL),
(216, '“Yêu em là thật, thương em cũng là thật. Nhưng anh nhận ra chúng mình không thuộc về nhau, ở bên nhau chỉ làm cả hai thêm đau khổ. Anh nghĩ, chia tay là cách tốt nhất để em và anh đều hạnh phúc”.', '33333', 'SamSungGalaxyS21Ultra', 197, 'https://www.wikihow.com/images/thumb/1/1b/Make-a-Farewell-Speech-Step-7-Version-4.jpg/v4-728px-Make-a-Farewell-Speech-Step-7-Version-4.jpg', '2023-06-27 03:12:45', NULL, NULL, NULL, NULL, NULL),
(217, 'Trong một thế giới đầy biến động và hỗn loạn, có những khoảnh khắc mang đến sự gặp gỡ giữa hai người trong những cách đẹp nhất và không ngờ tới. Đó là trường hợp khi tình yêu bùng cháy và số phận can thiệp, kết nối cuộc đời của hai tâm hồn', '000.232.32', 'Quạt máy Starts_GiNa', 190, 'https://i.ytimg.com/vi/_EcmcZ7aZxM/maxresdefault.jpg', '2023-06-27 03:31:45', NULL, NULL, NULL, NULL, NULL),
(218, 'Cảm ơn vì những ngày tháng tuyệt vời chúng ta đã có. Xin lỗi nếu có những lỗi lầm, những giọt nước mắt hay những lời nói không hay. Chúng ta là con người, chúng ta không hoàn hảo. Nhưng tất cả những điều đó đều là một phần của chúng ta, một phần của một chặng đường đã qua.', '111.234.2', 'Iphone ', 173, 'https://tse1.mm.bing.net/th?id=OIP.Jf4Gwx8rs2ykHsPrUT3pxQHaFN&pid=Api&P=0&h=180', '2023-06-27 04:10:33', NULL, NULL, NULL, NULL, NULL),
