(1, 'CN', 'The grandson saw that his grandfather had been single for a long time, so he took a wife less than 30 years old for him.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/smile.jpg', '0', '0', 55, '1', '1', 2, '0', 'Married young wife\r\n'),
(2, 'CN', 'Seeing that the grandfather liked the neighbor\'s grandmother but did not dare to confess, the grandchild pushed the boat to help him, who expected the neighbor\'s grandmother to like his grandchild.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sk3.jpg', '0', '0', 0, '0', '0', 0, '0', 'Unespected situation\r\n'),
(3, 'CN', 'Hearing the good news from his son, he was deaf when he was about to have a grandchild, he lost his hearing so his wife was pregnant while the two of them had not slept together for 3 years.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sk3.1.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sk3.1.png', '0', 45, '3', '3', 2, '0', 'Family mystery\r\n'),
(4, 'CN', 'When her son informed her that she was about to become a grandmother, she was so happy that she forgot to put on makeup. When she looked in the mirror, she saw that she had distorted her eyes, lips, and hair, making her husband unrecognizable.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/co_chau.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/co_chau.png', '0', 50, '0', '1', 1, '0', 'Behind the makeup\r\n'),
(5, 'CN', 'When she learned that her daughter was about to have a grandchild, she was so happy that she forgot to call. When she looked back, she found that she had dialed the wrong number and talked to a stranger for ten minutes.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/dt.jpg', '0', '0', 60, '0', '1', 1, '0', 'Excitement led to a blunder\r\n'),
(6, 'CN', 'When he heard that his son was about to have a grandson, he was so happy that he forgot to watch TV. When he looked back, he saw that he had dialed the wrong channel and watched the ghost movie for an hour.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/chau_noi.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/chau_noi.jpg', 28, '1', '0', 1, '0', 'Excitement turned to fright.\r\n'),
(7, 'CN', 'When she heard that her daughter was going to have a grandchild, she was so excited that she forgot to sew a shirt. When I looked down, I saw that I had sewn my husband\'s shirt wrong into my skirt.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/chau.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/chau.jpg', '0', 45, '0', '1', 1, '0', 'Happiness ended in a mess\r\n'),
(8, 'CN', 'When she was cutting her husband\'s hair, her son announced the good news that she was about to be promoted, she was so excited that she lost her husband\'s head.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hair.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hairnu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hair_nam.jpg', 30, '1', '1', 1, '0', 'Joy led to a hilarious mishap\r\n'),
(9, 'CN', 'Walking on the street, his daughter-in-law called to tell him the good news that he was about to become a grandfather, he was so happy that he speeded up the car and ended up with all his teeth.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/vnmec.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/vnmec.jpg', 70, '2', '0', 1, '0', 'Happy without teeth\r\n'),
(10, 'CN', 'Son gives good news to grandparents who are about to be promoted, but do not know that the child is the product of his wife and father', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/grandfather.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/grandfather.jpg', 65, '1', '0', 1, '0', 'Joy turns to a twist\r\n'),
(11, 'CN', 'When he heard that he was going to have a grandchild, he was so happy that he forgot to send an email. When I looked back at my computer, I saw that I had sent the wrong email to my boss and wrote: I love you, I want to marry you.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ab35eee5c998d58a6d5d375be6dd6d311708c4ec/chau.jpg', '0', '0', 0, '0', '0', 0, '0', 'Joyous blunder cost job\r\n'),
(12, 'CN', 'Knowing that she was about to become a grandmother, she rushed to her son\'s house, but went to the wrong house and slept with her son\'s neighbor.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heli.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heli.jpg', '0', 30, '1', '1', 2, '0', 'Mistaken identity.\r\n'),
(13, 'CN', 'Knowing that they were going to have a grandchild, the grandparents sold their house in the city to live with their son, but only after selling the house did they realize that the two children had tricked them into buying that house of theirs.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/house.jpg', '0', '0', 0, '0', '0', 0, '0', 'Betrayal of trust\r\n'),
(14, 'CN', 'When she heard that her son was about to have a grandchild, she was so happy that she forgot she was participating in a cooking competition. When she remembered, she was disqualified from the contest for not submitting her dish in time.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/cook.jpg', '0', '0', 0, '0', '0', 0, '0', 'Joyful distraction\r\n'),
(15, 'CN', 'He was shocked when his grandson belonged to his son and ex-girlfriend.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/su.avif', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/su.avif', 50, '1', '0', 1, '0', 'Grandson\'s parentage.\r\n'),
(16, 'CN', 'Visiting her newborn grandchild, her mother-in-law held her grandchild and was peed on her hand.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/cild.png', '0', '0', 0, '0', '0', 0, '0', 'Awkwardness and humor\r\n'),
(17, 'CN', 'She had not brushed her teeth for 3 years and heard her son announce that she was about to become a grandmother, she was so happy she kissed her husband on the lips and he died instantly because her mouth was too rotten.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kiss.jpg', '0', '0', 70, '2', '2', 0, '0', 'Tragic consequences\r\n'),
(18, 'CN', 'Seeing that the neighbor\'s grandparents were promoted to grandparents, the elderly couple decided to kidnap their grandchildren so that they could also be promoted to the same position as them.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hiking.jpg', '0', '0', 60, '1', '0', 0, '0', 'Illegal and wrong\r\n'),
(19, 'CN', 'When she heard that her son was about to have a grandson, she was so happy that she forgot she was teaching. When I remembered, I had a class, but the principal called me to notify me of my dismissal.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/45c73ba005a42ecd00a688ac7912cbda52e743ef/ba_noi.jpg', '0', '0', 0, '0', '0', 0, '0', 'Happiness comes at a price\r\n'),
(20, 'CN', 'She was shocked when she heard that her son without a girlfriend announced that he was going to have a grandchild.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/tenahisicoates.jpg', '0', '0', 40, '4', '0', 1, '0', 'Inappropriate relationship\r\n'),
(21, 'CN', 'She was shocked when her son got her boyfriend\'s daughter pregnant.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/bb_1.jpg', '0', '0', 30, '1', '1', 0, '0', 'Inappropriate relationship\r\n'),
(22, 'CN', 'An old couple fought with a split forehead just because they wanted their daughter-in-law to have a daughter.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/86907a12cfdb37a0b1403e0a8feaf61145a7bf38/gia.jpg', '0', '0', 0, '0', '0', 0, '0', 'Mystery unsolved\r\n'),
(23, 'CN', 'Hearing the news that their son was about to become a grandparent, the two happily went to show it to everyone in the village, but when they returned home, they remembered that their lover was also a boy, how did they have children?', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/end.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/end.jpg', 30, '1', '0', 1, '0', 'Uncertain future.\r\n'),
(24, 'CN', 'When he heard that he was going to have a grandchild, he was so happy that he laughed day and night, sending his children to a mental hospital.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Jail.jpg', '0', '0', 60, '1', '0', 0, '0', 'Uncertain future.\r\n'),
(25, 'CN', 'Hearing from the neighbors that he was about to become a grandfather, he was very happy to jump around, but his grandfather has been dead for 70 years and no one has ever had a grandchild.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d60b5c92d3b3b9d554ee60bcc08503adee2cf867/hinh_anh_ong.jpg', '0', '0', 0, '0', '0', 0, '0', 'Mistaken joy\r\n');
INSERT INTO `skchiatay` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'CT', 'The two broke up because he helped his best friend out of loneliness by regularly \'having fun\' with her.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/4b8e46b44a99edfc6d585c246c6972030d9c9bb5/ct1.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/1nu.png', '0', 25, '0', '2', 1, '0', 'Betrayal and heartbreak\r\n'),
(2, 'CT', 'You and your significant other will break up because one of you deceived the other and had a third-party relationship.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/101.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nu.101.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nam.101.png', 30, '1', '0', 2, 'namsau', 'Relationship over and trust gone\r\n'),
(3, 'CT', 'You and your partner broke up, because you found out your partner is the third gender', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/103.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/103.jpg', '0', 30, '0', '1', 1, '0', 'Acceptance and rejection\r\n'),
(4, 'CT', 'The husband and wife have separated because the wife has removed her makeup.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/114.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/114.jpg', '0', 27, '0', '4', 1, '0', 'Shallow and superficial.\r\n'),
(5, 'CT', 'You and your boyfriend will break up because he has too much money, and you don\'t like wealthy men. It just doesn\'t feel safe.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/102.jpg', '0', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/102.jpg', 35, '1', '0', 1, '0', 'Wealth and insecurity\r\n'),
(6, 'CT', 'The boyfriend came to visit his girlfriend and got bitten by her dog. They broke up because the boyfriend said that her dog didn\'t see him as family.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/ct6.jpg', '0', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nam6.png', 25, '1', '0', 1, '0', 'Dog bite and heartbreak\r\n'),
(7, 'CT', 'She thinks this guy always does \'silly\' things to make her laugh. She likes guys with a little crazy sense of humor. But then she finds out he\'s really silly — not that', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/115.jpg', '0', '0', 25, '0', '2', 1, '0', 'Expectation and reality.\r\n'),
(8, 'CT', 'She tells you that their lifestyles don\'t get along because she doesn\'t want to be Catholic and doesn\'t like raising her children that way.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/3-125921317.jpg', '0', '0', 27, '0', '2', 1, '0', 'Lifestyle differences.\r\n'),
(9, 'CT', 'He realizes that\'s not who he should marry when people fight with him every day.He listens and tries to fix it to improve the relationship but doesn\'t lose. That\'s beyond his acceptance threshold', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/4b8e46b44a99edfc6d585c246c6972030d9c9bb5/ct2.jpg', '0', '0', 25, '0', '1', 1, '0', 'Communication breakdown\r\n'),
(10, 'CT', 'He broke up with me. The reason is that my hair is thin, and his hair isn\'t very thick either. He\'s afraid that if we have children, our hair will become even thinner.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/105.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/105.jpg', '0', 25, '0', '4', 1, '0', 'Fear and doubt.\r\n'),
(11, 'CT', 'He and I broke up because his mother said I\'m not tall enough, which would affect their children\'s future. I\'m 1m60, and he\'s 1m58.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/116.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nu116.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nam116.png', 30, '4', '4', 2, 'namsau', 'Incompatibility and loss\r\n'),
(12, 'CT', 'The husband broke up with his wife because of a game that won him one billion.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/117.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nu117.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nam117.png', 40, '1', '1', 2, 'namsau', 'Greed and betrayal.\r\n'),
(13, 'CT', 'Break up because you save your lover\'s phone number as \"lion lady\".', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/shutterstock_525808639-1.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/shutterstock_525808639-1.jpg', '0', 40, '', '1', 1, '0', 'Wrong ID name\r\n'),
(14, 'CT', 'They broke up because their boyfriend was too poor. She was taken care of by a rich man.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/108.webp', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/108.webp', '0', 40, '4', '0', 1, '0', 'Materialism and greed.\r\n'),
(15, 'CT', 'Break up because your boyfriend won too much lottery and can\'t spend it all.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/ct11.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/ct11nu.png', '0', 35, '1', '0', 1, '0', 'Selfish and materialistic\r\n'),
(16, 'TG', 'They decided to separate because After getting married, the couple lived happily for 60 years.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/tai-hinh-anh-vo-chong-gia-di-hanh-phuc.jpg', '0', '0', 60, '2', '2', 0, '0', 'Happily ever after?\r\n'),
(17, 'TG', 'At the age of 60, the husband had an affair with a 35-year-old woman, despite the opposition from his wife and children.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/118.jpg', '0', '0', 60, '2', '2', 2, 'namsau', 'Midlife crisis\r\n'),
(18, 'CT', ' the wife demanded a breakup to go back to her ex-boyfriend because he became a billionaire.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/ct12.jpg', '0', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/ct12.jpg', 35, '5', '5', 1, '0', 'Unbelivable Decision\r\n'),
(19, 'TG', 'The rich boy suddenly became poor because he was going with someone else and was caught by his girlfriend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Can-Parents-Kick-You-Out-Without-Notice.jpg', '0', '0', 30, '1', '1', 2, 'namsau', 'Cheating Repercussions\r\n'),
(20, 'CT', 'At the age of 70, the husband discovered he was infertile and requested a divorce because the wife had four children with someone else.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/CT.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/CT.jpg', '0', 70, '1', '1', 1, 'namsau', 'Guilty Wife\r\n'),
(21, 'CT', 'He was so shocked when he heard that he was dumped by his girlfriend for not shaving for a month', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/fmax.jpg', '0', '0', 40, '1', '0', 1, '0', 'Breakup Reason?\r\n'),
(22, 'CT', 'Every time he went out, the boyfriend mentioned his ex-lover, and the girl broke up definitively.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/CN.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/CN.jpg', 35, '3', '3', 1, 'namsau', 'Disrespect\r\n'),
(23, 'CT', 'Every time he went to eat, the boyfriend was not attentive, only focused on eating full, his girlfriend blocked and didn\'t have it after that.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/break-up.jpg', '0', '0', 30, '1', '1', 2, 'namtruoc', 'bad habbit led to breakup\r\n'),
(24, 'CT', 'The guy is confident in his talent for flirting, saying goodbye to his girlfriend, since that breakup, he hasn\'t flirted with any girls.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/feel%20like.png', '0', '0', 27, '1', '1', 2, 'namtruoc', 'Loss Confidence\r\n'),
(25, 'CT', 'When his birthday was coming up, he saw his girlfriend asking for money, thinking she bought him a gift, who thought she would buy a gift for that guy\'s brother.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/gift.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/gift1.jpg', '0', 27, '1', '1', 1, 'namtruoc', 'Disappointment and Heartbreak\r\n');
INSERT INTO `skConLapGiaDinh` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'CLGD', 'Today, both families meet to discuss marriage', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8b2e02b294082376749910777349d01af94a9523/wedding1.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8b2e02b294082376749910777349d01af94a9523/wedding1_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8b2e02b294082376749910777349d01af94a9523/wedding1_A.jpg', 30, '1', '1', 2, 'namsau', 'Discuss marriage\r\n'),
(2, 'CLGD', 'The mother forces her son to see his eyes', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/680ac0f7c768c28a94b49187eae6229269dd14eb/XM.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/680ac0f7c768c28a94b49187eae6229269dd14eb/XM.jpg', '0', 28, '0', '2', 1, 'namtruoc', 'Blind date\r\n'),
(3, 'CLGD', 'After all the children got married, the couple stopped working to travel around the world', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6832391cd9888bda115e0f3f3e5d6c2b1aab783e/mi.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6832391cd9888bda115e0f3f3e5d6c2b1aab783e/mi_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6832391cd9888bda115e0f3f3e5d6c2b1aab783e/mi_n.jpg', 30, '1', '3', 2, 'namsau', 'Retirement Journeys\r\n'),
(4, 'CLGD', 'Mother-in-law and daughter-in-law often fight', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/3ac2b072c988f9a1b06af8e4bad7cc7c22ace168/mc.jpg', '0', '0', 40, '0', '1', 0, '0', 'Bitter Kinship\r\n'),
(5, 'CLGD', 'The mother objected to the son who asked to marry the girl who lost his virginity', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/e2521f26c617463d75f7d6fd10dde80d66ac5720/ctrai.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/e2521f26c617463d75f7d6fd10dde80d66ac5720/ctrai.jpg', 30, '1', '0', 0, '0', 'Love\'s Past Challenge\r\n'),
(6, 'CLGD', 'Single mother accepted the marriage proposal of a boy 10 years younger than her', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ffbc4e4115a038403a7067d8d79a5fb41efbe83c/married.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ffbc4e4115a038403a7067d8d79a5fb41efbe83c/married.jpg', '0', 30, '0', '1', 0, 'namtruoc', 'Ties of Timeless Love\r\n'),
(7, 'CLGD', 'The couple\'s son will marry the ex-girlfriend of the husband and the three of them will live together under one roof', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b6447077ce79093de63b2e7d0f88bd70fd46bf7a/js.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b6447077ce79093de63b2e7d0f88bd70fd46bf7a/js_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b6447077ce79093de63b2e7d0f88bd70fd46bf7a/js_nam.jpg', 40, '1', '1', 2, 'namtruoc', 'The Second Chance\r\n'),
(8, 'CLGD', 'In order to prevent the company from going bankrupt, the daughter decided to marry the son of the company\'s competitor', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/bbc6a166253bf2dff3811f0bd5f3905097e5cce9/girl.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/bbc6a166253bf2dff3811f0bd5f3905097e5cce9/girl.jpg', '0', 28, '0', '2', 0, '0', 'The Reluctant Bride\r\n'),
(9, 'CLGD', 'The mother was kicked out of the house by her daughter-in-law for not cooking for her', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/54a5e1f8314b1d417de5dc61f38471752202ef68/mother-daughter.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/54a5e1f8314b1d417de5dc61f38471752202ef68/mother-daughter.jpg', '0', 50, '0', '1', 0, '0', 'The Unwelcome Guest\r\n'),
(10, 'CLGD', 'At the wedding, the mother discovered that her new daughter-in-law was sneaking with her husband', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/34b6dfc0676d3366df905fc97a81ecda21ccfac0/con_dau.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/34b6dfc0676d3366df905fc97a81ecda21ccfac0/cd_nu.jpg', '0', 30, '1', '1', 1, 'namtruoc', 'The Wedding Day Betrayal\r\n'),
(11, 'CLGD', 'After holding their last wedding, the two children went on a honeymoon in Paris', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fd2c88d0bc121694341a094b0fadf855f21306bb/paris.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fd2c88d0bc121694341a094b0fadf855f21306bb/paris_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fd2c88d0bc121694341a094b0fadf855f21306bb/paris_nam.jpg', 30, '2', '2', 2, 'namsau', 'Romantic Getaway\r\n'),
