(4, 'GN', 'Oh my god, can you believe it? The girl went to eat noodles, met a lover again.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/GN.jpg', '0', '0', 35, '4', '0', 1, '0', 'See you when eating noodles'),
(5, 'GN', 'The guy turned the car back immediately when he saw that his new girlfriend on the internet was different from the one in the photo.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/25150520440_fda5682cf6.jpg', '0', '0', 25, '1', '0', 1, '0', 'Online Dating Disaster'),
(6, 'GN', 'The girl who went to the cafe to run the deadline, met the man sitting next to her and also ran the deadline', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Cafe-Manager-Interview-Questions.jpeg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Cafe-Manager-Interview-Questions.jpeg', '0', 30, '4', '3', 1, 'namtruoc', 'Deadline Partners'),
(7, 'GN', 'Thanks to the potholes on the road, the girl fell into the lap of a guy who was picking up bottles', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/img_3658-1518070215-261-width600height400.jpg', '0', '0', 35, '4', '0', 1, '0', 'Falling into a pothole on the road'),
(8, 'GN', 'The girl went to the supermarket to buy too many things that she couldn\'t bring back, caught the guy passing by, crying loudly, and the boy brought her home.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/5-1508669500186_1.png', '0', '0', 20, '0', '2', 1, '0', 'Kindness of Strangers'),
(9, 'GN', 'Seeing a beautiful girl crouching under the eaves of a small grocery store sheltering from the rain, the young man immediately ran into the shop to buy an umbrella, only to know that it was the owner\'s lover.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/M.O.jpg', '0', '0', 27, '2', '0', 1, '0', 'See you when it rains'),
(10, 'GN', 'On a beautiful day, the guy saw the girl\'s car break down in the middle of the road, the throttle to help made her car more damaged.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/The-Man.png', '0', '0', 30, '1', '0', 1, '0', 'Good Intentions, Bad Results'),
(11, 'GN', 'The News reports the ratio of male and female imbalance is increasing, the guy is scared, has a bold decision to go to the street to meet a girl who loves her, and meets a fat girl.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/TY.jpg', '0', '0', 27, '1', '1', 2, '0', 'The Bold Decision'),
(12, 'GN', 'The girl and her sister-in-law went to catch her husband\'s mistress, who expected that lover to be her boyfriend\'s sister', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/DG.jpg', '0', '0', 30, '1', '1', 1, 'namsau', 'Shocking Revelation'),
(13, 'GN', 'She just broke up with her lover, mourned and cried, went out to meet a technology taxi driver and took him home.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/DT.png', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/DT.png', 30, '2', '2', 1, 'namtruoc', 'Taxi Driver Who Healed Her Heart'),
(14, 'GN', 'The girl fell on the road and was helped by a man, she was imagining that man would be her true destiny, who would have thought that man had 5 wives?', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/5-vk.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/5-vk.jpg', '0', 50, '0', '1', 5, '0', 'The Man With Five Wives'),
(15, 'GN', 'It suddenly rained, the guy Accidentally gave the girl a hitchhiking and the car blew a tire.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nl.png', '0', '0', 27, '2', '2', 2, 'namsau', 'Rainy Day Romance'),
(16, 'GN', 'They got to know each other through the matchmaking of friends.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/BB.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/BB.jpg', 35, '1', '1', 2, 'namtruoc', 'Friendship That Blossomed into Love'),
(17, 'GN', 'That year, they met each other during Christmas', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Christmas.jpg', '0', '0', 35, '4', '4', 2, '0', 'Unwanted Bride'),
(18, 'GN', 'At his brother\'s wedding, he saw a pretty girl forced to marry him', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Son.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Son.jpg', '0', 28, '4', '4', 1, 'namtruoc', 'Wedding Day Deception'),
(19, 'GN', 'On her 23rd birthday, she met someone who always cared, cared for and loved her younger sister.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sister.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sister.jpg', '0', 23, '0', '1', 2, '0', 'Sister\'s Guardian Angel'),
(20, 'GN', 'The girl met the boy in the slum when her family kicked her out of the house because she was 40 and still had no boyfriend.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/8_1.jpg', '0', '0', 40, '0', '4', 0, '0', 'The Slum Girl and the Boy'),
(21, 'GN', 'The boy saw the pretty girl in front of her, walked around, and flirted with her, only to know that it was his mother and was dragged home by her mother\'s ear.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/me.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/me.jpg', '0', 50, '2', '2', 2, 'namtruoc', 'Mother He Didn\'t Recognize'),
(22, 'GN', 'The dating app created the first meeting between the couple and did not happen after that because both were too virtual, editing photos too violently.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hen-ho-1.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hen-ho-1.jpg', 25, '2', '2', 0, 'namtruoc', 'Virtual Relationship'),
(23, 'GN', 'The girl registered to participate in the dating program, was paired with her ex-boyfriend by the organizers.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/GN1.png', '0', '0', 30, '1', '1', 2, 'namtruoc', 'Reunited with an Ex'),
(24, 'GN', 'The girl was beaten on the first date because she didn\'t look like the picture on the internet', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/TN.jpg', '0', '0', 25, '2', '2', 2, '0', 'When Looks Matter Too Much'),
(25, 'GN', 'The guy who rented the room dropped the key standing in front of the inn, misunderstood by the girl as a thief to call the police, and he was taken to the police station.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/gn.png', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/gn.png', 30, '3', '0', 0, '0', 'unlucky guy');
