(1, 'HP', 'You will be taken on a trip by your lover, and the two of you will have fun days together.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp1.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp1nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp1nam.png', 27, '2', '2', 2, 'namtruoc', 'A Journey of Love\r\n'),
(2, 'HP', 'You will be taken by your partner to meet their family, to ask for permission to marry you.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/hp5.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp5nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp5nam.png', 36, '1', '1', 2, 'namtruoc', 'Meeting the In-Laws\r\n'),
(3, 'HP', 'You will be given gifts by your lover, not on the occasion of a holiday at all', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/hp3.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/hp3.jpg', '0', 25, '1', '1', 1, '0', 'The Perfect Gift\r\n'),
(4, 'HP', 'He will give you a Rolls-Royce car as a birthday present.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/awi1674345583%20(1).png', '0', '0', 32, '1', '1', 1, '0', 'Rolls-Royce Gift\r\n'),
(5, 'HP', 'You will receive a surprise gift from your significant other. Your family will have a new baby.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp8.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp8nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp8nam.png', 35, '1', '1', 2, 'namtruoc', 'The Best Surprise Ever\r\n'),
(6, 'HP', 'Three years later, you two will be able to buy a villa.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp9.jpg', '0', '0', 30, '3', '3', 2, 'namtruoc', 'The Villa Dream\r\n'),
(7, 'HP', 'In 3 years, you will become a billionaire.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp13.jpg', '0', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp13.jpg', 39, '1', '0', 1, '0', 'Billionaire Dream\r\n'),
(8, 'HP', 'After 1 year of being in a relationship, you will be fattened up by your significant other by 10 kg.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp11.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp11.jpg', '0', 30, '0', '1', 1, '0', 'The Weight of Love\r\n'),
(9, 'HP', 'At the age of 30, the husband will take his family on a world tour using his own airplane.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp12.jpg', '0', '0', 50, '1', '1', 2, 'namsau', 'A Family Adventure\r\n'),
(10, 'HP', 'At 37 years old, the husband and wife both became a nationally famous acting couple.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp14.jpg', '0', '0', 42, '1', '1', 2, 'namtruoc', 'The Dream Team\r\n'),
(11, 'HP', 'After discovering her husband\'s affair with his ex-girlfriend, the wife went to the ex-girlfriend\'s house to confront her and even resorted to cutting her hair and physically assaulting her.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/anh-chup-man-hinh-2021-04-06-luc-71937-sa-16176697300021258296524.png', '0', '0', 33, '', '2', 0, '0', 'A Woman Scorned\r\n'),
(12, 'HP', 'After getting married, the husband and wife inherited a large amount of assets from the husband\'s stepfather.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/hp16.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp16nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/hp16nam.png', 40, '1', '1', 2, 'namtruoc', 'Blessed with Inheritance\r\n'),
(13, 'HP', 'At the age of 60, they were happy to have their 3 children all grown up and successful.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/HP.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/HPn.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/HPa.jpg', 60, '3', '3', 1, 'namtruoc', '60 and Blessed with Successful Children\r\n'),
(14, 'HP', 'His greatest joy is waking up every morning to see his ugly wife preparing breakfast.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/an_sang.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/an_sang.jpg', '0', 30, '1', '1', 0, '0', 'Morning Bliss with His Beloved Wife\r\n'),
(15, 'HP', 'The girl was surprised when she received a proposal from her boyfriend in a crowded place', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/CH.jpg', '0', '0', 30, '1', '1', 0, 'namtruoc', 'A Surprise Proposal in the Crowd\r\n'),
(16, 'HP', 'The girl feels that she is very lucky to have an ugly husband, not afraid that her husband will go with her.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/love.jpg', '0', '0', 27, '1', '1', 1, 'namsau', 'True Love Beyond Looks\r\n'),
(17, 'HP', 'After 2 years of love, they decided to go home together.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/wedding.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/weddingu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/weddingn.jpg', 50, '1', '1', 2, '0', 'Two Years of Love, One Journey Home\r\n'),
(18, 'HP', 'You will feel happy when traveling with the person you love together.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/p.jpg', '0', '0', 27, '1', '1', 0, '0', 'Love\'s Destination: Joyful Traveling\r\n'),
(19, 'HP', 'Every day after work, the girl is picked up by her boyfriend.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hp.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hp-nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hp-nam.jpg', 25, '3', '3', 2, '0', 'Love\'s Daily Pickup\r\n'),
(20, 'HP', 'In the middle of the night, the girl\'s phone suddenly rang, it turned out that her boyfriend called to wish her good night.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/sleep.jpg', '0', '0', 27, '1', '0', 1, '0', 'Midnight Goodnight Call\r\n'),
(21, 'HP', 'The young man was at work, learned that he had won the lottery, and had to stop working to receive the prize.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Ts.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Ts.jpg', 50, '1', '0', 1, '0', 'A Life-Changing Announcement at Work\r\n'),
(22, 'HP', 'The girl was given a watch by her boyfriend on her 20th birthday.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/bring-gift.jpg', '0', '0', 20, '0', '0', 0, '0', 'The Gift of Time: 20th Birthday Watch\r\n'),
(23, 'HP', 'The girl was surprised to see another girl besides her lover, she was very happy because she had a reason to break up with this boyfriend, to start a relationship with someone else.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/new-boyfriend.jpg', '0', '0', 27, '1', '1', 1, '0', 'The Gift of Clarity: Love\'s Crossroads\r\n'),
(24, 'HP', 'The girl who was abandoned by her ex-boyfriend for a very bad reason, accidentally saw that the beauty of her current ex-girlfriend was even worse than her.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/woman.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/woman.jpg', '0', 27, '1', '1', 1, 'namsau', 'Lessons in Love and Beauty\r\n'),
(25, 'HP', 'The girl wearing a new dress entered the company and everyone complimented her that she was prettier than yesterday.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nu.jpg', '0', 35, '0', '1', 1, '0', 'A New Dress, a New Radiance\r\n');
INSERT INTO `skkethon` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'KH', 'On a fine day, you get good news. The couple had 1 baby and decided to get married. After 1 year together, you suddenly realize that the child is not yours', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/transracial-adoption-racial-identity-single-parent-LGBT.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/transracial-adoption-racial-identity-single-parent-LGBT.jpg', 30, '1', '0', 1, 'namsau', 'A Shocking Twist\r\n'),
(2, 'KH', 'You and she are prevented by your family from coming together. You are forced to marry someone else. For 6 months of marriage, you could not forget about her and had an affair with her', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/featuredImageId26280.jpg', '0', '0', 25, '1', '1', 0, '0', 'Star-Crossed Love\r\n'),
(3, 'KH', 'You two are married, and one day you are walking down the street to find out he is a third sex, he has been hiding from you for so long', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/77367839.jpg', '0', '0', 27, '1', '1', 2, 'namsau', 'Revelation of a Hidden Truth\r\n'),
(4, 'KH', 'What happens to you after marriage? You find out he has been having an affair with your best friend. You\'re glad there was a reason to break up because you\'re having an affair too.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/ngoai-tinh.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/48.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/49.jpg', 25, '1', '1', 2, 'namsau', 'Marriage Betrayals\r\n'),
(5, 'KH', 'One year after dating, they decided to get married. However, on their wedding night, the husband suddenly felt a strong, uncomfortable odor around him. When he kept asking, the bride finally shyly admitted that she had an issue with body odor.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/999.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/999.jpg', '0', 33, '1', '1', 2, 'namsau', 'Scented Surprise on Wedding Night\r\n'),
(6, 'KH', 'The husband and wife were prevented from being together by their families, and the husband was forced to marry someone else. After 6 months of marriage, the husband realized he still loved his ex-wife and had an affair with her.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/tinh-yeu-bi-ngan-cam-boi-gia-dinh-1.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/52.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/tinh-yeu-bi-ngan-cam-boi-gia-dinh-1.jpg', 30, '1', '1', 0, '0', 'Forbidden Love Rekindled\r\n'),
(7, 'KH', 'On the day of the wedding of the two, the husband met his ex-girlfriend again and developed feelings for her. In the first month of their marriage, the husband secretly contacted his ex-girlfriend.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/kh4.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/kh4nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/kh4nam.png', 26, '1', '1', 2, 'namtruoc', 'Marriage\'s First Challenge\r\n'),
(8, 'KH', 'On the wedding day of the couple, the husband had a traffic accident on the way to pick up his wife, was hospitalized, and the wedding ceremony was postponed.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/GettyImages-1230331949-1000x667.jpg', '0', '0', 40, '2', '2', 0, '0', 'Love Amidst Adversity\r\n'),
(9, 'KH', 'One month after getting married, the husband hit his wife because she didn\'t do housework.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/bao-luc-gia-dinh-hien-nay-1200x800-1633638359165423145265-0-128-670-1200-crop-1633638367567377342296.jpg', '0', '0', 32, '1', '1', 0, '0', 'Troubled Beginnings\r\n'),
(10, 'KH', 'One week after getting married, the husband lost his memory, forgot his wife, and asked for a divorce. The husband only remembered his ex-girlfriend.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/718aa9a4aae643b81af7.jpg', '0', '0', 42, '2', '2', 2, 'namsau', 'The Husband\'s Forgotten Vows\r\n'),
(11, 'KH', 'The wife secretly had an affair with the neighbor because her husband had erectile dysfunction.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/chong-cuong-an-ai-1131.jpg', '0', '0', 30, '2', '2', 0, '0', 'Secrets and Frustrations\r\n'),
(12, 'KH', 'After 2 years of marriage, the couple went bankrupt because the husband spent all the money on entertainment and girls.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/depositphotos_53691311-stock-photo-broke-bankrupt-young-couple.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/62.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/63.jpg', 31, '1', '1', 2, 'namsau', 'Secret Desire\r\n'),
(13, 'KH', 'The couple had a child, and the husband brought his wife home to introduce her to the family, but they were rejected because the family only liked the husband\'s ex-girlfriend.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/khonghoahop.jpg', '0', '0', 35, '0', '2', 0, '0', 'Struggles with Family Acceptance\r\n'),
(14, 'KH', 'After one week of marriage, the wife asked for a divorce upon discovering that her husband had a child with his ex-girlfriend.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/its-time-to-divorce.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/65.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/66.jpg', 27, '1', '1', 2, 'namsau', 'Marriage\'s Shocking Revelation\r\n'),
(15, 'KH', 'At 45 years old, the couple\'s son will marry the ex-girlfriend of the husband and the three of them will live together under one roof.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/chup-anh-gia-dinh-4-nguoi-6-1.png', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/67.png', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/68.png', 43, '2', '2', 2, 'namsau', 'A Twist of Fate\r\n'),
(16, 'KH', 'At 46 years old, one year after their son married his ex-girlfriend and had a child, the wife discovered that the child was actually her husband\'s.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/sinhcongai1-min.jpg', '0', '0', 23, '2', '2', 0, '0', 'A Surprise Paternity\r\n'),
(17, 'KH', 'The boy saw the beautiful neighbor, determined to go home and ask his parents to bring the bride to ask her to marry him.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/maried.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/maried.png', '0', 30, '5', '5', 1, 'namsau', 'From Neighbor to Life Partner\r\n'),
(18, 'KH', 'The couple got married for a month before they knew they were cousins.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Sam.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Sam-nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/Sam-man.jpg', 30, '1', '1', 2, '0', 'Love Beyond Family Ties\r\n'),
(19, 'KH', 'Every day the husband comes home late because he does not want to hear the grumbling words of the lion female.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kh.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kh.jpg', 35, '2', '2', 1, '0', 'Avoiding the Lioness\r\n'),
(20, 'KH', 'Married for 1 year, the wife became ugly because her husband used a lot to wear out her beauty.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/K_H.jpg', '0', '0', 35, '1', '0', 0, 'namtruoc', 'The Toll of Marriage\r\n'),
(21, 'KH', 'After receiving his salary, the young man hurriedly stopped by the shop to make a few beers for him, or didn\'t come home, there was a lioness waiting.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/give-money.jpg', '0', '0', 35, '1', '1', 0, 'namsau', 'A Lioness Waits at Home\r\n'),
(22, 'KH', 'The boy was surprised to learn that the two children he raised for 8 years were not his own.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/soc.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/soc.jpg', 45, '1', '0', 0, '0', 'A Father\'s Identity Unraveled\r\n'),
(23, 'KH', 'Married for 10 years, the husband was surprised to learn that he was infertile and had 3 children.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hm.jpg', '0', '0', 45, '0', '0', 0, '0', '10 Years of Unknowing Parenthood\r\n'),
(24, 'KH', 'The girl was returned in the night when her husband saw her bare face.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kh1.jpg', '0', '0', 30, '0', '1', 0, '0', 'Secret She Kept\r\n'),
(25, 'KH', 'The wife was surprised to learn that her husband\'s lover was her best friend.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/image-_1_.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/image-_1_.jpg', '0', 30, '0', '1', 1, '0', 'Painful Truth\r\n');
INSERT INTO `sklyhon` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'LH', 'After 3 years of marriage, the husband and wife divorced because the husband had erectile dysfunction.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/Husband-unhappy-and-disappoint.jpg', '0', '0', 29, '5', '5', 0, '0', 'The Marriage That Couldn\'t Survive\r\n'),
(2, 'LH', 'What happens after you two get married? The two of you will soon break up because your male friend is addicted to alcohol and drugs', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/alcohol-withdrawal-timeline-1.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/72.jpg', '0', 23, '0', '1', 1, '0', 'Battling Addiction and Heartbreak\r\n'),
(3, 'LH', 'After visiting the hospital for a check-up, the husband discovered that he was infertile, but his wife had a child. So, whose child is it?', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/vo_sinh_nam.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/74.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/73.jpg', 34, '1', '1', 2, 'namtruoc', 'Secret Child\r\n'),
(4, 'LH', 'After 2 years of marriage, the husband and wife divorced because the wife went to her husband\'s company to physically attack him out of jealousy, which impaired his mental well-being.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/vo_sinh_nam.jpg', '0', '0', 32, '1', '0', 1, 'namsau', 'A Marriage Marred by Jealousy\r\n'),
(5, 'LH', 'After 2 years of marriage, the husband and wife divorced because the husband discovered that his wife had been having an affair with his brother and that their current child was not his own.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/998.jpg', '0', '0', 27, '0', '1', 0, '0', 'The Truth That Shattered a Marriage\r\n'),
(6, 'LH', 'After 1 year of marriage, the wife discovered that her husband was having an affair with her sister behind her back.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/1-1551953708604657186659.jpg', '0', '0', 35, '0', '2', 0, '0', 'Sisterly Love or Unholy Lust?\r\n'),
(7, 'LH', 'After 1 month of marriage, the wife requested a divorce because she found out that her husband was bisexual and had cheated on her with another man.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/2930_1.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/2930_1.jpg', 34, '2', '0', 1, 'namsau', 'A Marriage Ends in Discovery\r\n'),
(8, 'LH', 'The husband decided to divorce his beautiful wife after discovering her deceit. She had never told him about her extensive plastic surgery to look as beautiful as she did.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/upset-chinese-man-woman-having-quarrel-kitchen-middle-aged-young-looking-opposite-sides-husband-wife-thinking-divorce-255720116.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/79.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/80.jpg', 30, '2', '2', 2, 'namsau', 'Deceptive Beauty\r\n'),
(9, 'LH', 'After 1 week of marriage, the wife decided to divorce because she discovered that her husband was not as wealthy an heir as she had thought.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/12-Warning-Signs-Your-Marriage-Is-Over-According-To-Experts-6.jpg', '0', '0', 31, '0', '1', 1, '0', 'The Marriage Unraveled\r\n'),
(10, 'LH', 'The husband discovered that his wife had been deceiving him for many years. When they first started dating, she had claimed to be 24 years old, but in reality, she was 34 years old.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/photo1599731820862-15997318208681037861370-crop-1599731880352378356155.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/photo1599731820862-15997318208681037861370-crop-1599731880352378356155.jpg', 33, '2', '2', 1, 'namtruoc', 'Deceitful Love\r\n'),
(11, 'LH', 'The husband requested a divorce because his wife was too violent. The wife found out that her husband was having an affair, so she grabbed a knife and hired someone to beat up the other woman.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/ngoai-tinh11-403.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/ngoai-tinh11-403.jpg', 29, '2', '2', 2, 'namsau', 'Love\'s Dark Tangle\r\n'),
(12, 'LH', 'After one month of marriage, the husband requested a divorce because his wife was too dirty. She only took a bath and washed her hair once a week.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/pexels-rhema-11790891-1.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/pexels-rhema-11790891-1.jpg', 33, '3', '0', 1, 'namtruoc', 'A Soiled Marriage\r\n'),
(13, 'LH', 'After their wedding night, the husband requested a divorce because he couldn\'t accept that his wife was no longer a virgin.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/phu-nu-con-trinh-2.jpg', '0', '0', 22, '0', '2', 1, '0', 'A Marriage Misconception\r\n'),
(14, 'LH', 'On their wedding night, the wife was extremely upset when she heard her newlywed husband call her the wrong name, another woman\'s name. The next day, she demanded a divorce.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/shutterstock_593479430.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/shutterstock_593479430.jpg', '0', 34, '1', '1', 1, '0', 'Wedding Night That Ended in Divorce\r\n'),
(15, 'LH', 'The husband insisted on divorcing because the shaman said that his wife was a demon who had bewitched him, always made trouble, and took his money.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/women-rights-in-husband-property-after-divorce.jpg', '0', '0', 25, '1', '1', 2, 'namtruoc', 'Power of Superstition\r\n'),
(16, 'LH', 'How will the two of you be at 70 years old? The husband has taken another wife, and there are 3 people living together under the same roof.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/lay-hai-vo.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/93.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/94.jpg', 70, '1', '1', 2, 'namtruoc', 'Future of Polygamy\r\n'),
(17, 'LH', 'Divorce because of being abandoned by their children, each has their own way.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/nqh03331-1617362160533182927786.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/nqh03331-1617362160533182927786.jpg', 70, '2', '0', 1, 'namtruoc', 'The Road Less Traveled\r\n'),
(18, 'LH', 'At the age of 60, the husband proposed a divorce because his wife refused to brush her teeth and her breath was too bad to bear.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/vo%20chong.jpg', '0', '0', 60, '1', '1', 0, '0', 'Too Much to Bear\r\n'),
(19, 'LH', 'At the age of 60, the husband refused to die and his wife put poison in the food. After finding out her husband asked for a divorce.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/loi-khai-roi-nuoc-mat-cua-nguoi-vo-len-bo-thuoc-doc-vao-thuc-an-cua-chong-suot-2-thang_1.jpg', '0', '0', 60, '1', '0', 0, '0', 'A Marriage in Ruins\r\n'),
(20, 'LH', 'After giving birth, the husband proposed a divorce to his wife because she was too sloppy.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/messy-lady.jpg', '0', '0', 24, '0', '2', 0, '0', 'A Bittersweet Ending\r\n'),
(21, 'LH', 'One week after getting married, the wife demanded a divorce because the husband slapped and hit her for talking too much.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/33227487-husband-wants-to-harm-his-wife-with-slap-domestic-violence.jpg', '0', '0', 36, '1', '1', 0, '0', 'A Week of Marital Abuse\r\n'),
(22, 'LH', 'Her husband\'s lust was too much, causing her to tire and propose a divorce.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/20131126085542-congai1.jpg', '0', '0', 27, '2', '0', 2, 'namsau', 'A Marriage Strained by Lust\r\n'),
(23, 'LH', 'At the age of 50, the husband requested a divorce after discovering that he had a serious illness.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/co-tich.jpg', '0', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/co-tich.jpg', 37, '2', '2', 1, 'namtruoc', 'Fateful Illness\r\n'),
(24, 'LH', 'After one year of marriage, the wife gave birth to their first daughter, but the husband demanded a divorce because his family did not like having a granddaughter.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/1_Stressed-Mother-Holding-Crying-Baby-Suffering-From-Post-Natal-Depression-At-Home.png', '0', '0', 33, '', '1', 1, '0', 'The Gender Gap\r\n'),
(25, 'LH', 'After a year of marriage, the wife had an affair with the father-in-law and had a child with him. The husband discovered and requested a divorce. The wife then married the father-in-law, and the husband and wife continued living together and called each other mother and son.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/photo1595839489548-15958394895591286687615-crop-15958395965421888302794.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/109.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/108.jpg', 49, '4', '4', 2, 'namtruoc', 'Incestuous Affair\r\n');
