(23, 'dg23', 'Walking on the street, he found her and her boss swinging on the roll royce', 'https://github.com/duongbang093/futureLove2/blob/main/danhghen/sk23.png?raw=true', '0', '0', '30', '1', '1', 0, '0', 'Caught cheating\r\n'),
(24, 'dg24', 'She discovered the smell of cheap perfume that students used in his car', 'https://github.com/duongbang093/futureLove2/blob/main/danhghen/sk24.jpg?raw=true', '0', 'https://github.com/duongbang093/futureLove2/blob/main/danhghen/sk24-nam.jpg?raw=true', '29', '1', '1', 2, 'namsau', 'Cheap perfume\r\n'),
(25, 'dg25', 'During a party at a karaoke bar, his partner joins in and sings a romantic song with lyrics that remind him of an affair, causing his lover to vibrate with his sixth sense.', 'https://github.com/duongbang093/futureLove2/blob/main/danhghen/sk25.jpg?raw=true', '0', '0', '28', '1', '1', 0, '0', 'Lyrics trigger flashback\r\n');
INSERT INTO `sknym` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'NYM', 'One week after breaking up, at her wedding, you caught a glimpse of her older sister. And both of you fell in love after that wedding.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/saostar-le6fhlsuzpwzbgwf.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nnu1.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nnam1.png', 27, '1', '1', 2, '0', 'Sister catches your eye.\r\n'),
(2, 'NYM', 'What will you be like after 3 years of breaking up? Will you have to get back with your ex because you couldn\'t pay off all your debts to them?', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/293cee056821d6bd1973558c958211490e48a29a/N-Y-M.jpg', '0', '0', 27, '5', '5', 0, '0', 'Debts force you back.\r\n'),
(3, 'NYM', 'You will have a new lover at your ex-girlfriend\'s wedding, and that will be her best friend.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b18a7ec181255705cc82fa43ab003dbc176e4b7f/Nam_tay.png', '0', '0', 25, '5', '5', 0, '0', 'Lover at ex-girlfriend\'s wedding.\r\n'),
(4, 'NYM', 'The wife discovered that her husband had proposed to break up with his ex-girlfriend because her family was too poor. He had fallen in love with his wife because of material possessions.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/chia-tay-ban-gai-doi-300-trieu-tien-phi-qua-3-nam-toi-bat-khoc-nhin-nguoi-ben-canh-em-1_248726-1623952986-194-width640height480.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/chia-tay-ban-gai-doi-300-trieu-tien-phi-qua-3-nam-toi-bat-khoc-nhin-nguoi-ben-canh-em-1_248726-1623952986-194-width640height480.jpg', '0', 30, '', '2', 1, '0', 'Husband broke up for money.\r\n'),
(5, 'NYM', 'At the age of 35, the husband and wife will reunite and proceed to marriage.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/nym1.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nym2nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nym1nam.png', 35, '2', '2', 2, 'namtruoc', 'Couple reunites at 35.\r\n'),
(6, 'NYM', 'At the age of 40, the wife returned to her husband because at that time he was a wealthy heir.', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/happy-wife-welcoming-her-military-husband-after-returning-back-home-from-army_116547-17523.jpg', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/happy-wife-welcoming-her-military-husband-after-returning-back-home-from-army_116547-17523.jpg', '0', 40, '', '3', 1, '0', 'Wife returns for wealth.\r\n'),
(7, 'NYM', 'After the breakup, the husband returned to his ex-girlfriend because she was more beautiful than his wife.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/bae6a364b3cd0bd0e22b28b66cbb0f2a72858915/girlfriend.png', '0', '0', 30, '5', '5', 0, '0', 'Husband returns to ex.\r\n'),
(8, 'NYM', 'At 50 years old, how will the two of you be? The husband already has a new girlfriend, who is a famous singer.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/ct11.jpg', '0', '0', 50, '1', '0', 1, '0', 'Husband has new gif at 50.\r\n'),
(9, 'NYM', 'At 30 years old, who will be in your family? The family consists of 7 people: the husband, the wife, and 5 children.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c5ce2790419080e97db4df33adc797a0f42c417e/Gia_dinh.jpg', '0', '0', 30, '5', '5', 0, '0', 'Family of 7 at 30\r\n'),
(10, 'NYM', 'After the husband and wife broke up, the husband fell in love with his  best friend and they got married. After a year, they broke up because the husband realized he still loved his ex-wife.', 'https://raw.githubusercontent.com/thuykieu06012002/futurelove/main/nym3.jpg', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nym3nu.png', 'https://raw.githubusercontent.com/thuykieu06012002/cutimage/main/nym3nam.png', 40, '4', '4', 2, 'namtruoc', 'Still love ex-wife\r\n'),
(11, 'NYM', 'After breaking up, the husband discovered that he was the third sex. Husband and husband\'s best friend fell in love', 'https://raw.githubusercontent.com/ducmanhnguyen1308/-nh-cho-future-love/main/dong-tinh-luyen-ai-do-dau11453804634.jpg', '0', '0', 45, '1', '0', 1, '0', 'In love with best friend after breakup\r\n'),
(12, 'NYM', 'One week after breaking up with his wife, the husband started dating his teacher who is 20 years older than him.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym_nu.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym_nam.png', 40, '1', '1', 0, '0', 'Old lady love\r\n'),
(13, 'NYM', 'After 2 weeks of breaking up, the wife was proposed by the husband\'s older brother. The wife and the older brother got married and lived together under the same roof.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym1.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym1_nu.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym1_nam.png', 35, '1', '1', 0, 'namtruoc', 'Brother conflict\r\n'),
(14, 'NYM', 'The beauty of the ex-boyfriend\'s new girlfriend is so bad, that beauty is not even half half of her.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/myn.jpg', '0', '0', 25, '0', '2', 1, '0', 'Ex-bf\'s new gf not hot\r\n'),
(15, 'NYM', 'You suddenly realize your new lover is your ex\'s best friend and they have known each other for a long time.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/myn1.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/myn1.jpg', 30, '1', '1', 1, '0', 'New lover is ex\'s bestie\r\n'),
(16, 'NYM', 'You and your new lover go shopping at the supermarket. You, unfortunately, lost your wallet and do not have the money to pay for the goods. Your new lover says they will pay you but when they go to the cashier they run away.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/myn2.jpg', '0', '0', 27, '2', '0', 0, '0', 'Lover ditches at checkout.\r\n'),
(17, 'NYM', 'You and your new lover go to eat ice cream at a famous ice cream shop. Little did you know that your new lover is a huge fan of a famous singer and they met their idol at that ice cream parlor. Your new lover has left you behind to pursue that singer.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/060434b8ad6c27d2e1abf2ece021c2f24d4328d0/valentine-1.2.jpg', '0', '0', 0, '0', '0', 0, '0', 'Lover ditched for singer.\r\n'),
(18, 'NYM', 'Introduced to her family by her new boyfriend, the stressed-out sweaty girl washed away her make-up, making her boyfriend not recognize her and mistakenly picking up her roommate.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym_1.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nym_1.png', '0', 27, '0', '1', 1, '0', 'Makeup-less girl mistaken.\r\n'),
(19, 'NYM', 'You and your new lover go to a birthday party. You don\'t know that your new lover is a very sociable and funny person. At the party, your new lover has made friends with everyone and has kissed front of you with another girl.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/1.2.jpg', '0', '0', 35, '2', '2', 0, 'namsau', 'Lover\'s social skills backfire.\r\n'),
(20, 'NYM', 'She and her new lover go to a thrilling game. During the play, she feels normal and excited, and her lover screams, fearfully hugging her.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/1.3.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/1.3.png', '0', 30, '0', '4', 1, '0', 'Lover scared at thrilling game.\r\n'),
(21, 'NYM', 'You and your new lover go to eat pizza at a famous restaurant. Little did you know that your new crush is a huge fan of a K-pop group and they met their idol at that pizzeria. Your new lover has left you behind to run with that band and ask for autographs.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6d174f328c9e21ea10aabaf206b0e8599c8b1900/an_toi.jpg', '0', '0', 0, '0', '0', 0, '0', 'Lover ditches for K-pop.\r\n'),
(22, 'NYM', 'The 23-year-old girl met her new boyfriend online, and when she met her, she was shocked when that boyfriend was her father.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/6.jpg', '0', '0', 23, '2', '2', 2, 'namtruoc', 'Father revealed as boyfriend.\r\n'),
(23, 'NYM', 'The girl and her new lover had a date to go to the park. The girl wanted to commemorate the photos with her new lover and asked a passerby for help. Unexpectedly, the person being asked was his ex-girlfriend, he stole the phone and ran away.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ae02276886372a3b84aef6bbefb7a99144108eb1/hen_ho.jpg', '0', '0', 30, '1', '0', 0, '0', 'Ex-girlfriend steals phone.\r\n'),
(24, 'NYM', 'The girl and her new boyfriend participated in an intelligence contest on television and had to answer a question related to her ex-lover, everyone around her thought of letting go of this question, but she insisted on answering for her. By all means, she spent a whole day telling all the information about her ex-lover, causing her new boyfriend to lose face and leave her first.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/1.5.png', '0', '0', 30, '3', '1', 1, 'namsau', 'Girl talks about ex, loses boyfriend.\r\n'),
(25, 'NYM', 'The guy invites his new girlfriend to a restaurant and always orders food that causes the girl to have an allergic reaction, and to be hospitalized.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/1.4.jpg', '0', '0', 28, '0', '1', 0, '0', 'Guy\'s food allergy prank backfires.\r\n');
INSERT INTO `skSinhConDauLong` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'SC', 'After 3 years of marriage, the couple had their first child', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/199520e5219fb91678ee3d787edbee40fe256bf5/mon.jpg', '0', '0', 30, '1', '1', 0, '0', 'Sibling rivalry\r\n'),
(2, 'SC', 'After 4 years together, the husband discovered that the first child was the neighbor\'s son', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/380ed3f174c0556b0e37fb8610b6d8dcab17e5ed/images.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/380ed3f174c0556b0e37fb8610b6d8dcab17e5ed/images.jpg', 35, '1', '0', 0, '0', 'Oldest brother\'s jealousy\r\n'),
(3, 'SC', 'After giving birth to her first child, the husband discovered that he was infertile', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/3d034b89f67c45a071bb0395927d7ff8b4bc6605/condau.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/3d034b89f67c45a071bb0395927d7ff8b4bc6605/condau_n.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/3d034b89f67c45a071bb0395927d7ff8b4bc6605/condau_a.png', 39, '1', '1', 2, '0', 'Husband\'s infidelity\r\n'),
(4, 'SC', 'The wife is always angry with her husband for no reason after giving birth to the first child', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6cfbf084d15247b29a821e26d6fe45665776aa3a/cau.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6cfbf084d15247b29a821e26d6fe45665776aa3a/cau.jpg', '0', 30, '0', '1', 1, '0', 'Family inheritance dispute\r\n'),
(5, 'SC', 'While pregnant with her first child, the wife discovered that her husband had an affair and had a child of his own', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2146f8543459646022ce9d295022c02adff630ba/bau.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2146f8543459646022ce9d295022c02adff630ba/bau.jpg', '0', 28, '0', '2', 1, '0', 'Mother\'s favoritism\r\n'),
(6, 'SC', 'The husband wants a divorce from his wife because the first child born is a girl', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ed0f445fd112f1641f5b032dedf060570b1fd1f9/ly.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ed0f445fd112f1641f5b032dedf060570b1fd1f9/ly.jpg', '0', 30, '0', '2', 0, '0', 'Infertility\r\n'),
(7, 'SC', 'Mother forces her son to marry a girl because she is pregnant with his first child', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6904d470764697099bb267ab88cb952614366d50/mang_bau.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6904d470764697099bb267ab88cb952614366d50/mang_bau.png', '0', 30, NULL, '1', 0, '0', 'Biological family discovery\r\n'),
(8, 'SC', 'The wife is despised by her husband\'s family because she is a girl at birth', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c23d9c94ff418cadf6875e46be0ef6cf6da25a98/New-Mom-Baby.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c23d9c94ff418cadf6875e46be0ef6cf6da25a98/New-Mom-Baby.png', '0', 32, NULL, '1', 0, '0', 'Wif\'s resentment\r\n'),
(9, 'SC', 'After 23 years of abandoning her first child, the son returned to take revenge on the mother who abandoned him', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8b09da23382600b938ca70a32af6b256b99cd9a2/mon_1.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8b09da23382600b938ca70a32af6b256b99cd9a2/mon_1.png', '0', 45, NULL, '2', 1, '0', 'Liver donation\r\n'),
(10, 'SC', 'Although divorced, the mother-in-law still tries to rob her first grandson', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f38c647e8f5371a4575becd38cfa49a7be27709e/mother..jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f38c647e8f5371a4575becd38cfa49a7be27709e/mother..jpg', '0', 30, NULL, '1', 0, '0', 'Marital breakdown\r\n'),
(11, 'SC', 'Divorced for 5 years, the husband meets his wife again and discovers that she has a 5-year-old child', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6b84a1b70ce70f858639f22d20cb0705f499a98f/couples.jpeg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6b84a1b70ce70f858639f22d20cb0705f499a98f/couples_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6b84a1b70ce70f858639f22d20cb0705f499a98f/couples_a.jpg', 35, '1', '1', 2, '0', 'Mother\'s abuse\r\n'),
(12, 'SC', 'Once, the wife found out that her only child was swapped with her best friend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/a22daada26ec5ab3f46d42cb166352dbe79568b5/cry.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/a22daada26ec5ab3f46d42cb166352dbe79568b5/cry.jpg', '0', 35, NULL, '1', 0, '0', 'Second child\'s marriage\r\n'),
(13, 'SC', 'The girl discovered that the neighbor\'s only child had many similarities with her husband', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/120e511ad2862588b90ea9cf3182e4e901dd2997/parents.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/120e511ad2862588b90ea9cf3182e4e901dd2997/parents_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/120e511ad2862588b90ea9cf3182e4e901dd2997/parents_a.jpg', 45, '1', '1', 2, '0', 'Family tragedy\r\n'),
(14, 'SC', 'The wife received a huge fortune from her husband\'s family when she gave birth to her first child, a boy', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b93a5e8b77197ec64783198acbbe27be6d88978c/Gally.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b93a5e8b77197ec64783198acbbe27be6d88978c/Gally_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b93a5e8b77197ec64783198acbbe27be6d88978c/Gally_a.jpg', 35, '1', '1', 1, '0', 'Sisters\' estrangement\r\n'),
(15, 'SC', 'The first child was born and thrown away, growing up now accidentally works at the mother\'s company', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f2c5ff69aef7a55116872f4f9d0aa735074dd9e4/bay.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f2c5ff69aef7a55116872f4f9d0aa735074dd9e4/bay.jpg', '0', 30, NULL, '1', 0, '0', 'Gambling debt\r\n'),
(16, 'SC', 'The newly born and abandoned child is now the lover of her current biological daughter', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c45738b3b28e16a7d6ae3155f9e2ce88cc06a61b/love_Banh_mi.jpg', '0', '0', 28, '1', '1', 0, '0', 'Husband\'s gambling addiction\r\n'),
(17, 'SC', 'My only child fell in love with the enemy\'s daughter', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/5b729b5379f34366a8723f428402bd2ee6e5f0ec/boy.jpg', '0', '0', 30, '1', '1', 0, '0', 'Second daughter\'s marriage\r\n'),
(18, 'SC', 'The eldest son is rich and the second son is poor', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/9d0e6772631e4e8145462f2cd9b72854f29d24f2/rich.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/9d0e6772631e4e8145462f2cd9b72854f29d24f2/rich_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/9d0e6772631e4e8145462f2cd9b72854f29d24f2/rich_man.jpg', 35, '2', '2', 2, '0', 'Unwanted pregnancy\r\n'),
(19, 'SC', 'The wife found out that her husband was having an affair with her stepchild.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d70dd7e60a298118606c9056a6d32400f1d62a3a/ck.jpg', '0', '0', 60, '1', '1', 0, '0', 'Early marriage\r\n'),
(20, 'SC', 'The eldest son found out that his father molested his daughter-in-law', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8f12d4033b13207e8bbd030cfddf5d32415c47bb/man.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8f12d4033b13207e8bbd030cfddf5d32415c47bb/man.jpg', 55, '1', NULL, 1, '0', 'Unexpected birth\r\n'),
(21, 'SC', 'Because she was poor, she abandoned her first child but was picked up and raised by her best friend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/de99ff6732c1837e65886c741338ce3534f1c47a/nhan_nuoi.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/de99ff6732c1837e65886c741338ce3534f1c47a/nhan_nuoi.jpg', '0', 35, NULL, '1', 0, '0', 'Early speech development\r\n'),
(22, 'SC', 'At the age of 16, the girl gave birth to a child. Her mother decided to adopt her grandchild as a daughter', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fe84d077bb23fddd414ce67e057cde2e2109068f/mami.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fe84d077bb23fddd414ce67e057cde2e2109068f/mami.jpg', '0', 35, NULL, '1', 1, '0', 'Quick labor and delivery\r\n'),
(23, 'SC', 'The husband discovered that the first child was the wife\'s child with the housekeeper', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/be2555244891e02c9f89fb856ee0db998acafc90/buon.jpeg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/be2555244891e02c9f89fb856ee0db998acafc90/buon.jpeg', 30, '1', '0', 0, '0', 'Baldness from childbirth\r\n'),
(24, 'SC', 'The father is shocked to see that his son is a math prodigy.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2fe08c7665c577f0664ccbfc37ed8d7feda450fd/contrai.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2fe08c7665c577f0664ccbfc37ed8d7feda450fd/contrai.jpg', 40, '1', '0', 0, '0', 'Unexpected second pregnancy\r\n'),
(25, 'SC', 'Parents divorce just because the first child loves his mother more than his father.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c10a07bca0f0077457e03394703a554055f9f189/ctay.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c10a07bca0f0077457e03394703a554055f9f189/ctay_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c10a07bca0f0077457e03394703a554055f9f189/ctay_nam.jpg', 38, '3', '3', 1, '0', 'Gender disappointment\r\n');
INSERT INTO `skSinhConThuHai` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, '', 'After giving birth to their first child, the couple decided to have another child next year', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/0b4b25070287d86e4e6065b2a51fe038374f0e0c/sinhcon.jpg', '0', '0', 30, '1', '1', 0, 'namsau', 'Sibling rivalry\r\n'),
(2, '', 'The oldest brother hates the second brother because he feels that his parents no longer love him', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b22dd1e51a0d16a1ed10645bbdc440b63f04893c/anh_em.jpg', '0', '0', 20, '2', '0', 0, '0', 'Oldest brother\'s jealousy\r\n'),
(3, '', 'Husband was shocked when he found out that his second child was a neighbor\'s child.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/4861997e5d2743c935898bc44b8c06c174529b26/sad.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/4861997e5d2743c935898bc44b8c06c174529b26/sad.jpg', 35, '1', '0', 0, '0', 'Husband\'s infidelity\r\n'),
(4, '', 'In order to fight for the inheritance, the two brothers\' families cut off ties with each other', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/27373e9206d841307244f3f1e153a7efa3e12d15/two_bro.png', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/27373e9206d841307244f3f1e153a7efa3e12d15/two_bro.png', 35, '1', '0', 2, '0', 'Family inheritance dispute\r\n'),
(5, '', 'In order for her second son to study abroad, the mother forced her first son to drop out of school and work part-time to earn money', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/7c1ced88cf8556fcf8fc82b1cf9830577f29adc3/DH.png', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/7c1ced88cf8556fcf8fc82b1cf9830577f29adc3/DH.png', 30, '2', '0', 1, '0', 'Mother\'s favoritism\r\n'),
(6, '', 'The husband wanted to have a second child but found out that he was infertile', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/vk.png', '0', '0', 30, '1', '1', 0, 'namtruoc', 'Infertility\r\n'),
(7, '', 'At the age of 24, the second son discovered that he was the biological son of a tycoon family', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/4dd5f5006ac5b76664daa05bd3d671771cc935e9/bthu.jpg', '0', '0', 24, '1', '0', 0, '0', 'Biological family discovery\r\n'),
(8, '', 'The wife feels angry because her husband forced her to have a second child because the family is too poor', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/af26f66885a0040a246939b277206f4ba69ff48c/head.jpg', '0', '0', 30, '1', '1', 0, 'namsau', 'Wife\'s resentment\r\n'),
(9, '', 'In order for the second son to live, the eldest decided to donate a liver', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8643c3eefa40eb980c5b40f296610018585d4969/manya4.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/8643c3eefa40eb980c5b40f296610018585d4969/manya4.jpg', 35, '3', '0', 1, '0', 'Liver donation\r\n'),
(10, '', 'Husband still leaves his wife to follow his mistress even though they are two people with two small children', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/73cba37eca8cdba1a4738927ad90a7f53c81d7be/leave_wife.jpg', '0', '0', 35, '1', '1', 0, 'namtruoc', 'Marital breakdown\r\n'),
(11, '', 'The mother always beat and scolded the eldest son because she thought he was the one who killed the son', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/a6fea303a27c684dbefbbb3e116fb3887f956ea0/d_c.png', '0', '0', 35, '0', '1', 0, '0', 'Mother\'s abuse\r\n'),
(12, '', 'The mother was surprised when her ugly second child also got married.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/fbb8564d40e4c3804375a4424980742252bede42/lv.jpg', '0', '0', 30, '1', '1', 0, 'namsau', 'Second child\'s marriage\r\n'),
(13, '', 'She passed away after giving birth to her second child.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/aeac9cf998a00c903125b9d7e03529afe5b34c9b/kickded.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/aeac9cf998a00c903125b9d7e03529afe5b34c9b/kickded.jpg', 30, '3', '0', 0, '0', 'Family tragedy\r\n'),
(14, '', 'In order to marry into a rich family, the younger sister severed ties with her first twin sister', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f3a7c670c51b4d3a2bfef79ef2a9673906521535/ss.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f3a7c670c51b4d3a2bfef79ef2a9673906521535/ss.jpg', '0', 35, '0', '3', 0, '0', 'Sisters\' estrangement\r\n'),
(15, '', 'The whole family had to go to the street to live because of the gambling debt.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ebca907d9b12ed1179f646d2114eff456f04ed2b/gm.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ebca907d9b12ed1179f646d2114eff456f04ed2b/gm.jpg', 35, '1', '0', 0, '0', 'Gambling debt\r\n'),
(16, '', 'The second daughter married a poor man, making the eldest sister jealous because she was loved by her husband.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/79012573a0445eb52aac5921af2d8c92e200bf54/Happy.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/79012573a0445eb52aac5921af2d8c92e200bf54/Happy_n.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/79012573a0445eb52aac5921af2d8c92e200bf54/Happy_ma.png', 30, '1', '1', 2, 'namtruoc', 'Husband\'s gambling addiction\r\n'),
(17, '', 'Her husband\'s family promised her a big villa after she gave birth to her second baby, but when she gave birth to the baby, her husband\'s family became beggars because her husband played cards.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/04cc0822b1a6971e79cea061b87608e29b838173/bem.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/04cc0822b1a6971e79cea061b87608e29b838173/bem.jpg', '0', 30, '0', '1', 0, '0', 'Second daughter\'s marriage\r\n'),
(18, '', 'They went to the doctor and said their second baby would be a girl, they prepared clothes for a girl, but when the doctor took it out, it was a boy.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2de4ce7a7c25b4e26cba32174ffab48d676e06f7/betrai.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2de4ce7a7c25b4e26cba32174ffab48d676e06f7/betrai.jpg', '0', 30, '0', '1', 0, '0', 'Unwanted pregnancy\r\n'),
(19, '', 'She married early, she was only 20 years old and gave birth to a second child.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ef12e4eae74fef5d266bb54f7d4feeca7d3ed02e/sinsom.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ef12e4eae74fef5d266bb54f7d4feeca7d3ed02e/sinsom.jpg', '0', 20, '0', '2', 1, '0', 'Early marriage\r\n'),
(20, '', 'The boy was surprised to see his wife\'s small belly, after a natural stomachache she gave birth to the second princess of the family.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/29378628fbb38cb61646ec259aaeed316d673275/congchua.jpg', '0', '0', 35, '1', '1', 0, 'namsau', 'Unexpected birth\r\n'),
(21, '', 'The father was shocked to see his son say Hello old man when he was only 5 months old.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f0e90e00e0119db179e5edcad9a10c0fabb7ed0e/np.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f0e90e00e0119db179e5edcad9a10c0fabb7ed0e/np.jpg', 35, '4', '0', 1, '0', 'Early speech development\r\n'),
(22, '', 'The girl was pregnant with the second child, she was in labor pain and was on the operating table for 2 minutes, she gave birth to a healthy baby.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/60095f74bd4150937596208706dcf046a61154e1/de.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/60095f74bd4150937596208706dcf046a61154e1/de.png', '0', 30, '0', '2', 0, '0', 'Quick labor and delivery\r\n'),
(23, '', 'He has been bald since his wife gave birth to their second child because during labor his wife grabbed his hair.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/0312e10bd0795ffdb1850f81b65f14c684047bee/hpi.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/0312e10bd0795ffdb1850f81b65f14c684047bee/hpi.jpg', 35, '2', '0', 1, '0', 'Baldness from childbirth\r\n'),
(24, '', 'The husband came home to find his wife had a stomachache. Ask your wife if she\'s okay. The wife said she was giving birth to a second child. The husband was shocked because his first child was only three months old. His wife laughed and joked, just ate a lot.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b78c1393aca91d3d96b64ddc31d70a0a7a6fefcd/seconds.jpeg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b78c1393aca91d3d96b64ddc31d70a0a7a6fefcd/seconds.jpeg', '0', 30, '0', '1', 0, '0', 'Unexpected second pregnancy\r\n'),
(25, '', 'The girl was shocked when her second child was born a girl because before going to the doctor, she told her to give birth to a boy.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b4ecc61911f6b386096714ec3bfa5a0c71f7ecd9/soc.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b4ecc61911f6b386096714ec3bfa5a0c71f7ecd9/soc.jpg', '0', 30, '0', '2', 1, '0', 'Gender disappointment\r\n');
INSERT INTO `skToTinh` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngwap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'TT', 'On the occasion of the girl\'s birthday, the boy confessed to her', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/966e35df50486d0b18f10996b85994d60f51afd3/tt.jpg', '0', '0', 28, '2', '2', 0, 'namsau', 'Birthday love confession\r\n'),
(2, 'TT', 'When the two were married, the wife discovered that her best friend had confessed to her man', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6939541219afa32488a10864b1b4a94c56275e4c/t_t.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6939541219afa32488a10864b1b4a94c56275e4c/t_t_nu.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6939541219afa32488a10864b1b4a94c56275e4c/t_t_a.png', 38, '1', '1', 2, 'nantruoc', 'Betrayal of trust\r\n'),
(3, 'TT', 'Discovered ex-lover proposed to another girl on the street', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/099ae33181eac71fe04697bacccef94183a89458/ph.png', '0', '0', 30, '1', '1', 0, 'namsau', 'Heartbroken on the street\r\n'),
(4, 'TT', 'The girl was confessed to by the boy in the garbage dump.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c982f405bce20c3877a9a51d6321f6325ffba991/bai_rac.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/c982f405bce20c3877a9a51d6321f6325ffba991/bai_rac.jpg', '0', 28, '0', '2', 0, '0', 'Garbage dump confession\r\n'),
(5, 'TT', 'The boy confessed but the girl refused because she already has someone she likes', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/4530848d5a7fe87377f89201c6c25bce3a26f335/no.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/4530848d5a7fe87377f89201c6c25bce3a26f335/no.jpg', '0', 28, '0', '1', 1, '0', 'Unrequited love\r\n'),
(6, 'TT', 'When he was drunk, the boy confessed his love to the girl', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/72ea3e243ad186874c0151758795fb46fc5da6a3/TT_.jpg', '0', '0', 30, '5', '5', 0, 'nantruoc', 'Drunken love confession\r\n'),
(7, 'TT', 'The girl who regrets rejecting another guy\'s confession to marry is now a ghost man.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/62e3c05d67984a43d918c7bd2d3acf29756fbee4/hh.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/62e3c05d67984a43d918c7bd2d3acf29756fbee4/hh_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/62e3c05d67984a43d918c7bd2d3acf29756fbee4/hh_nam.jpg', 30, '4', '4', 0, 'namsau', 'Ghost of regret\r\n'),
(8, 'TT', 'The girl rejects the guy because he is a Luffy pirate pirate.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/21e0ae70cd5f7f68d3756dde6013f0436919ecd7/cb.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/21e0ae70cd5f7f68d3756dde6013f0436919ecd7/cb.jpg', 30, '1', '0', 1, '0', 'Love lost to the sea\r\n'),
(9, 'TT', 'Accepted the boy\'s confession, but the girl\'s family objected because of her family background', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2a3877aacc11740c63b565bf424f8d5d652c4a33/c_y.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2a3877aacc11740c63b565bf424f8d5d652c4a33/c_y.jpg', '0', 28, NULL, '1', 0, '0', 'Love forbidden by family\r\n'),
(10, 'TT', 'The girl cursed at the boy, for confessing there was only a flower but not a branded bag', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d75c4eb4d8225833fadcdfc21a92297722cde140/Floret.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d75c4eb4d8225833fadcdfc21a92297722cde140/Floret.jpg', '0', 28, NULL, '1', 0, '0', 'Materialistic love\r\n'),
(11, 'TT', 'The boy confessed his love so romantic that it made the girl sleepless all night.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/1768bd11a845d2f8fc7ca6ccb0fceb834cf91413/kiss.png', '0', '0', 28, '1', '1', 0, 'nantruoc', 'Love confession insomnia\r\n'),
(12, 'TT', 'The girl told her best friend about the boy who confessed to her. But unexpectedly he is the secret lover of her best friend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2fac78da9081d4c71738aae315b23acfafc08e9b/anh.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2fac78da9081d4c71738aae315b23acfafc08e9b/anh_n.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/2fac78da9081d4c71738aae315b23acfafc08e9b/anh_nam.jpg', 28, '1', '1', 0, 'nantruoc', 'Best friend\'s secret lover\r\n'),
(13, 'TT', 'The boy sent a love letter to the girl but his best friend hid it.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/a41a98eefb629c225c5fe71c479e76896e96e78b/mae.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/a41a98eefb629c225c5fe71c479e76896e96e78b/mae.jpg', '0', 25, '0', '1', 0, '0', 'Love letter intercepted\r\n'),
(14, 'TT', 'Right in front of the group of friends, the boy confessed to the girl. The girl agrees but it\'s a bet', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d8807bd3687ed0898d4b5f908cd811ce9e8ce0f0/tu.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d8807bd3687ed0898d4b5f908cd811ce9e8ce0f0/tu_nu.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/d8807bd3687ed0898d4b5f908cd811ce9e8ce0f0/tu_nam.png', 25, '1', '1', 1, 'nantruoc', 'Love confession as a bet\r\n'),
(15, 'TT', 'After 4 failed confessions, he decided to give up on the girl and go with his best friend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/62ed7b515b8b5b89836dc2353d0a03b26180aa65/totinh.png', '0', '0', 25, '2', '2', 0, 'nantruoc', 'Love lost, friendship found\r\n'),
(16, 'TT', 'The boy who confessed to his boss was rejected, because she thought he was greedy.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/cd6593cf69ae6a49700974caaad1a84dc19259ec/That_tinh.jpg', '0', '0', 25, '2', '2', 0, 'namsau', 'Love lost to doubt\r\n'),
(17, 'TT', 'The 30-year-old boy confessed unsuccessfully because he bought a fake ring for the girl.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/nhan.jpg', '0', '0', 30, '0', '0', 0, '0', 'Love lost to deception\r\n'),
(18, 'TT', 'In order to quickly inherit the family\'s career, the guy gave up the confession of the girl he loved to marry the daughter of a tycoon family.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/90f429fc6f33d4273dbcb892ad12df09524f1ce4/tu_choi.jpg', '0', '0', 30, '1', '1', 0, 'nantruoc', 'Love sacrificed for ambition\r\n'),
(19, 'TT', 'Unable to accept that the girl was close to other men, he decided to confess to the girl. But she rejected him because she didn\'t like him because he was poor', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/73741b5a4fc471a8cfaa9187bd1031df7b197cb8/tb.jpg', '0', '0', 28, '1', '1', 0, 'namsau', 'Love rejected, poverty a barrier\r\n'),
(20, 'TT', 'The girl was very happy when the boy confessed, but suddenly another girl appeared and claimed to be his fiancée', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/37ffd4ba1dbe2ebe865c3ff366da5dcf413b295e/_sad.jpg', '0', '0', 28, '1', '1', 0, 'namsau', 'Love triangle heartbreak\r\n'),
(21, 'TT', 'Right at the wedding ceremony, the girl canceled the wedding because she discovered that her boyfriend\'s house was poor. The guy directly confessed to his best friend and left the wedding', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6af39a9b7c7994c47f6b61d09c01f1e653baff1e/wed.png', '0', '0', 30, '1', '1', 0, 'nantruoc', 'Love lost to materialism\r\n'),
(22, 'TT', 'The boy who confessed was rejected by the girl from the first sentence because his mouth was so rotten that she couldn\'t stand it.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/6aa9bdf401fa41d122ece65d04a3d70112cb3659/tuchoi.jpg', '0', '0', 30, '1', '1', 0, 'nantruoc', 'Love lost to bad breath\r\n'),
(23, 'TT', 'The boy who confessed failed because he was so handsome that the girl didn\'t feel safe around him.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/bfe8dd14b07bc4691457e93de29778807b5aba66/Sad-woman.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/bfe8dd14b07bc4691457e93de29778807b5aba66/Sad-woman.jpg', '0', 28, NULL, '1', 0, '0', 'Too handsome, too dangerous\r\n'),
(24, 'TT', 'The girl thought the guy she asked to kiss her but found out it wasn\'t herself but her best friend', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ef18276d4f2d6a9ea9460e1c528068f41680df66/ch.png', '0', '0', 20, '1', '1', 0, 'nantruoc', 'Kiss of mistaken identity\r\n'),
(25, 'TT', 'After two months of accepting the confession, the girl discovered that the boy was a promiscuous boy and digger', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/ef18276d4f2d6a9ea9460e1c528068f41680df66/ht.png', '0', '0', 28, '1', '0', 0, '0', 'Relationship\'s foundation cracked');
INSERT INTO `skvohoacchongchettruoc` (`id`, `mask`, `thongtin`, `image`, `nu`, `nam`, `Dotuoi`, `danam`, `danu`, `ngswap`, `vtrinam`, `tomLuocText`) VALUES
(1, 'VHCCT', 'The husband had a heart attack when he learned that the children he raised were the products of his wife and brother.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heart.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heart.jpg', 60, '1', '0', 1, '0', 'Husband\'s world shattered\r\n'),
(2, 'VHCCT', 'At the age of 60, the husband wanted his old ugly wife to die first so that he could go one step further, not beyond the expected result that he was the first to die.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/images.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/images.jpg', 60, '1', '0', 0, '0', 'Unrequited love\r\n'),
(3, 'VHCCT', 'When he heard the news of his wife\'s death, he was overjoyed that he would be able to take another step forward with beautiful girls.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/492294108.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/492294108_1.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/492294108_2.jpg', 35, '1', '1', 0, '0', 'Husband\'s relief'),
(4, 'VHCCT', 'When she heard that her husband died of poisoning with her cooking, she tried the food she cooked but was still alive', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/luie.avif', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/luie.avif', '0', 40, '0', '1', 1, '0', 'Cooking mistake mystery\r\n'),
(5, 'VHCCT', 'Hearing the neighbor\'s news that her husband had died from stabbing a chicken, her sister-in-law quickly took her husband home to find out that the dead man was the neighbor\'s husband.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/image.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/image.jpg', '0', 35, '1', '1', 1, '0', 'Husband\'s death a mix-up\r\n'),
(6, 'VHCCT', 'Seeing that his wife was beaten away by the waves, the husband immediately jumped to save his wife, but he could not swim and died, now his sister-in-law is happy with her new husband.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/i.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/i.jpg', 35, '1', '0', 0, '0', 'Widow\'s new life\r\n'),
(7, 'VHCCT', 'Her husband, suffering from cancer, passed away 3 weeks ago.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hs1lastmonth04-zz.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hs1lastmonth04-zz_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/hs1lastmonth04-zz_nam.jpg', 50, '1', '1', 2, '0', 'Cancer took husband\r\n'),
(8, 'VHCCT', 'At the age of 70, the old woman passed away when she heard that her husband was still able to play with 3 mistresses outside.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/gett.jpg', '0', '0', 70, '1', '1', 1, '0', 'Heartbreak killed the old\r\n'),
(9, 'VHCCT', 'The old man had a heart attack when he heard that his 60-year-old wife still asked to lift her breasts to swing with young men.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heart_dr.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/heart_dr_gr.jpg', '0', 60, '1', '1', 1, '0', 'Heartbroken old man\r\n'),
(10, 'VHCCT', 'The boy owes too much money and commits suicide to not have to pay the debt, but every time he commits suicide, people save his life.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/tutu.jpg', '0', '0', 30, '1', '0', 0, '0', 'Debt-ridden boy\'s plight\r\n'),
(11, 'VHCCT', 'Waking up in the morning, the husband was kissed on the lips by his wife, he died on the spot because his wife\'s breath was too rotten.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/smell.jpg', '0', '0', 30, '1', '1', 0, '0', 'Kiss of death\r\n'),
(12, 'VHCCT', 'The wife died on the spot when drinking too much alcohol, then the husband took the flight attendant as his wife.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/drinking.png', '0', '0', 30, '0', '1', 0, '0', 'remarried flight attendant\r\n'),
(13, 'VHCCT', 'The sister-in-law took her own life when she learned that her husband and sister were dating behind her back.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kar.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kar_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/kar_nam.jpg', 30, '1', '1', 2, '0', 'betrayal led to suicide\r\n'),
(14, 'VHCCT', 'The husband committed suicide because his wife said his lower body was too small', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/79d4d01fb716f3b248fb04df75edb5aa370ecc6a/sk_die.jpg\r\n', '0', '0', 0, '0', '0', 0, '0', 'Hurtful words\r\n'),
(15, 'VHCCT', 'The sister-in-law laughed at the company when she heard that her husband hit the butt of the pig, which suffocated and died.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/080823f230a77031d9ab1e8ab20a7706fd11c5a0/Cuoi.jpg', '0', '0', 0, '0', '0', 0, '0', 'Wife\'s emotion\r\n'),
(16, 'VHCCT', 'Husband commits suicide because his wife forces him to submit papers every day', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/7e0a78013a76567b8c91908119e8a47c28706b1f/man_c%C6%B0%C6%A1i.jpg', '0', '0', 0, '0', '0', 0, '0', 'Pressure and depression\r\n'),
(17, 'VHCCT', 'Her husband had just passed away, and the wife had gone back and forth with her husband\'s father.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/funeral.jpg', '0', '0', 35, '1', '1', 0, '0', 'Unespected relationship\r\n'),
(18, 'VHCCT', 'His wife is likened to a lion. One day, when he heard a neighbor inform him that his wife had died because he was defeated by a raccoon, he hurriedly threw a party for 7 days and 7 nights.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/b4baa38b8a184036ac9f247604d5ebb56825ed4c/tiec.jpg', '0', '0', 0, '0', '0', 0, '0', 'Party after wife\'s death\r\n'),
(19, 'VHCCT', 'Because the wife is too ugly, she wants to die first so that her husband can take another step with the beautiful girl, but every time she commits suicide, everyone helps her, causing the angry husband to have a stroke and die soon after.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/AdobeStock_105041739-scaled.jpeg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/AdobeStock_105041739-scaled.jpeg', '0', 35, '1', '1', 1, '0', 'Man go first\r\n'),
(20, 'VHCCT', 'The 60-year-old man, lying in bed for 2 days, made his wife wake up thinking he was dead, worried about the funeral, when he was placed in the coffin, he opened his eyes.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/main-qimg-cb9eafa2496983d6fe7f94a8cb9a5a6b-lq.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/main-qimg-cb9eafa2496983d6fe7f94a8cb9a5a6b-lq.jpg', 50, '1', '0', 1, '0', 'Wake up in coffin\r\n'),
(21, 'VHCCT', 'The wife died on the spot when she learned that her husband\'s mistress was the stepdaughter of her ex-husband.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/f076d039e2a7d6c9406aa9d8199eb0449e7fdcb1/die.jpg', '0', '0', 0, '0', '0', 0, '0', 'Unimaginable\r\n'),
(22, 'VHCCT', 'After listening to the wife\'s gifted voice, the husband had a perforated eardrum and died on the spot', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/lovepik.jpg', '0', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/lovepik.jpg', 35, '2', '2', 1, '0', 'Dying by a Gift\r\n'),
(23, 'VHCCT', 'The husband has been dead for 3 years, and the wife has taken another step forward, however, the new husband died on the wedding night, because she had a husband\'s number.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/marriage.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/marriage_nu.jpg', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/marriage_nam.jpg', 35, '1', '1', 2, '0', 'Dying in wedding\r\n'),
(24, 'VHCCT', 'When he learned that his wife had died from a nuclear bomb, the husband was so upset that he forgot to eat.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/pi.jpg', '0', '0', 35, '1', '0', 0, '0', 'Sadness Husband\r\n'),
(25, 'VHCCT', 'The husband died on the wedding night when his wife weighed 105kg on him.', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/big_heo.png', 'https://raw.githubusercontent.com/spiderdassness/anh_raw/main/big_heo.png', '0', 35, '0', '1', 1, '0', 'Dying of Weighed);\r\n');
